// Function to clear the cache of the current tab
function clearCache() {
    // Check if the browser supports the Cache API
    if ('caches' in window) {
        // Open the caches
        caches.open('name-of-your-cache').then(function(cache) {
            // Clear all entries from the cache
            cache.keys().then(function(keys) {
                keys.forEach(function(key) {
                    cache.delete(key);
                });
                console.log('Cache cleared successfully.');
            });
        });
    } else {
        console.log('Cache API is not supported in this browser.');
    }
}

// Call the function to clear the cache
clearCache();